購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。ジムニーJA11の1型の内、<br>
極初期のフレームNO109433までの車両には<br>
ワイパー取り付け方法が異なるため装着できません。<br>
それらの車両もそれ以降の純正ワイパーアームに<br>
交換すれば装着可能になります。<br>
JB31シエラ及び平成3年2型以降JA11は全て装着可能です。<br>
